import React, {useRef} from 'react'
import { Container, Form } from 'react-bootstrap'

const Login = () => {
  const refId = useRef()

  return (
    <Container>
      <Form>
        <Form.Group>
          <Form.Label>Enter Your Id</Form.Label>
          <Form.Control type="text" ref={refId} required/>
        </Form.Group>
      </Form>
    </Container>
  )
}

export default Login
